import three from '../assets/png/iimbx.png'
import four from '../assets/png/linkedin.png'


export const achievementData = {
    bio : "Here are some of my favourite certifications/learning",
    achievements : [
        {
            id : 2,
            title : 'AWS Solution Architect - Associate Certification',
            details : 'Validate technical skills and cloud expertise to grow your career and business.',
            date : 'July, 2022',
            field : 'Cloud',
            image : 'https://images.unsplash.com/photo-1523474253046-8cd2748b5fd2?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1050&q=80'
        },
        {
            id : 4,
            title : 'Finance Foundations',
            details : 'The course by Linkedin taught me about the foundations of world of finance, from analyzing risk and return and obtaining financing to understanding how markets and banks operate.',
            date : 'December, 2022',
            field : 'Finance',
            image : four
        },
        {
            id : 1,
            title : 'Project Management Course ',
            details : 'This course by Coursera taught me these skills: Dispel risks that cause project failure. Maintain satisfaction of stakeholders. Excellent communication skills throughout all parties; clients, employees and managers.',
            date : 'Oct 20, 2022',
            field : 'Management',
            image : two
        },
        {
            id : 3,
            title : 'DO Your Venture: Entrepreneurship For Everyone',
            details : 'The course by IIMBx taught me about planning for starting a business and the steps involved in it.',
            date : 'August, 2022',
            field : 'Business',
            image : three
        },
    ]
}


